import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';

const HomeSlider = () => {
    return (
        <AwesomeSlider>
            <div>1</div>
            <div>2</div>
            <div>3</div>
            <div>4</div>
            <div>5</div>
        </AwesomeSlider>
    )
}

export default HomeSlider
